import React, { useState, useEffect } from "react";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Menu from "./pages/Menu";
import Orders from "./pages/Orders";
import "./LoginRegister.css";

export default function App() {
  const [user, setUser]   = useState(null);
  const [cart, setCart]   = useState([]);
  const [tab, setTab]     = useState("login");
  const [view, setView]   = useState("menu"); // 'menu' | 'cart' | 'orders'

  // Încarcă user și coș
  useEffect(() => {
    const rawUser = localStorage.getItem("user");
    if (rawUser && rawUser !== "undefined") {
      try { setUser(JSON.parse(rawUser)); }
      catch { localStorage.removeItem("user"); }
    }
    const rawCart = localStorage.getItem("cart");
    if (rawCart && rawCart !== "undefined") {
      try { setCart(JSON.parse(rawCart)); }
      catch { localStorage.removeItem("cart"); }
    }
  }, []);

  // Login / Logout
  const handleLogin = u    => { setUser(u); localStorage.setItem("user", JSON.stringify(u)); };
  const handleLogout = ()  => { setUser(null); setCart([]); localStorage.removeItem("user"); localStorage.removeItem("cart"); };

  // Coș
  const handleAddToCart = item => {
    const next = [...cart, item];
    setCart(next);
    localStorage.setItem("cart", JSON.stringify(next));
  };
  const handleSetCart = newCart => {
    setCart(newCart);
    localStorage.setItem("cart", JSON.stringify(newCart));
  };

  // Dacă nu e autentificat
  if (!user) {
    return (
      <div className="single-card-wrapper">
        <div className="logo-box">
          <h1 style={{
            fontSize: 32, margin: 0, color: "#333", fontWeight: 700,
            textShadow: "0 1px 1px rgba(0,0,0,0.1)"
          }}>
            Orderly
          </h1>
        </div>
        <div className="form-tab-card">
          <div className="tabs">
            <button
              className={tab === "login" ? "active" : ""}
              onClick={() => setTab("login")}
            >Login</button>
            <button
              className={tab === "register" ? "active" : ""}
              onClick={() => setTab("register")}
            >Register</button>
          </div>
          {tab === "login"
            ? <Login onLogin={handleLogin} />
            : <Register />
          }
        </div>
      </div>
    );
  }

  // Dashboard
  return (
    <div
      style={{
        padding: 20,
        display: "flex",
        flexDirection: "column",
        alignItems: "center"
      }}
    >
      {/* Header */}
      <header style={{
        width: "100%",
        maxWidth: 900,
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        marginBottom: 20
      }}>
        <h1 style={{ textAlign: "center", flex: 1 }}>
          Bine ai venit, {user.name}
        </h1>
        <button
          onClick={handleLogout}
          style={{
            padding: "8px 16px",
            borderRadius: 4,
            backgroundColor: "#e63946",
            color: "#fff",
            border: "none",
            cursor: "pointer"
          }}
        >
          Logout
        </button>
      </header>

      {/* Navbar */}
      <nav style={{
        width: "100%",
        maxWidth: 900,
        display: "flex",
        justifyContent: "center",
        gap: 10,
        marginBottom: 20
      }}>
        {["menu","cart","orders"].map(v => (
          <button
            key={v}
            onClick={() => setView(v)}
            style={{
              padding: "8px 16px",
              borderRadius: 4,
              backgroundColor: view === v ? "#007bff" : "#ccc",
              color: "#fff",
              border: "none",
              cursor: "pointer"
            }}
          >
            {v === "menu" ? "Meniu" : v === "cart" ? "Coș" : "Comenzi"}
          </button>
        ))}
      </nav>

      {/* Conținut */}
      <div style={{ width: "100%", maxWidth: 900 }}>
        {view === "menu" && (
          <section>
            <h2 style={{ textAlign: "center" }}>Meniu</h2>
            <Menu onAddToCart={handleAddToCart} />
          </section>
        )}

        {view === "cart" && (
          <section>
            <h2 style={{ textAlign: "center" }}>Coș</h2>
            {cart.length === 0 ? (
              <p style={{ textAlign: "center" }}>Coșul este gol.</p>
            ) : (
              <ul style={{ listStyle: "none", padding: 0, textAlign: "center" }}>
                {cart.map((it,i) => (
                  <li key={i} style={{ marginBottom: 8 }}>
                    {it.name} x{it.quantity}
                  </li>
                ))}
              </ul>
            )}
          </section>
        )}

        {view === "orders" && (
          <section>
            <h2 style={{ textAlign: "center" }}>Comenzi existente</h2>
            <Orders cart={cart} setCart={handleSetCart} user={user} />
          </section>
        )}
      </div>
    </div>
  );
}
